import React from "react";
import PeopleDetails from "./PeopleDetails";
import card from "../assets/Card.svg"; 
import plus from "../assets/plus.svg"
export default function AllCardsDetailsView({name, birth_year,species,homeworld,vehicles,starships})
{



    return(

      <div>
        <div className="w-[#969696] h-[98px] bg-[#969696] mr-[24px] rounded-t-[8px] flex justify-between">
            <img src={card} alt="Card Icon" />
            <h4>{name}</h4>
            <div>
            <img className="w-[10px] h-[10px] border-[1px] " src={plus} alt="Plus Icon" />
            </div>
        </div>

        <div>
        <h4>{birth_year}</h4>
        <h4>{species}</h4>
        </div>

        <div>
        <h4>{homeworld}</h4> <h4>{name}</h4>
        <h4>{vehicles}</h4> <h4>{name}</h4>
        <h4>{starships}</h4> <h4>{name}</h4>
        </div>


      </div>

    );





}
